    [],nt"num_tags": 6,nt"name": "trempealeau-national-wildlife-refuge-annual-narrative-report-calendar-year-1995",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Trempealeau
    National Wildlife Refuge summarizes Refuge activities during the 1995 calendar year.
     The report begins with a summary of the yearu2019s highlights and climatic conditions.
     Land acquisition is also covered.  The report includes a planning section which
    discusses the master plan, the management plan, public participation, research,
    and investigations.  Refuge administration is outlined; information about personnel,
    manpower programs, volunteer programs, funding, safety, and technical assistance
    is given.  Habitat management is also covered.  Subjects include wetlands, forests,
    grasslands, haying, fire management, pest control, wilderness areas, Farmers Home
    Administration Easements, and private lands.  The wildlife section of the report
    discusses wildlife diversity, endangered species, threatened species, waterfowl,
    marsh birds, waterbirds, shorebirds, raptors, game mammals, fisheries resources,
    and marking/banding.  The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive exhibits, hunting, fishing, trapping, wildlife
    observation, and law enforcement.  The equipment and facilities section of the report
    provides information about new construction, rehabilitation, equipment utilization/replacement,
    and computer systems.  Cooperative programs are provided at the end; Refuge brochures
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
